import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div>
      <h1>Фильмдер Қолданбасына қош келдіңіз!</h1>
      <p>Мұнда сіз фильмдер жинағын басқара аласыз және әр фильм туралы мәліметтерді көре аласыз.</p>
      <div style={{ display: "flex", flexDirection: "column" }}>
  <Link to="/movies" className="btn btn-primary">Go to Movies</Link>
  <Link to="/categories" className="btn btn-primary">Go to Categories</Link>
</div>

    </div>
  );
};

export default HomePage;
